css:
atom-text-editor,
:host {
  background-color: white;
  color: black;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: darkgray !important;
}
atom-text-editor .selection .region,
:host .selection .region {
  color: black;
  background-color: lightskyblue;
}
atom-text-editor .comment,
:host .comment,
atom-text-editor .annotation,
:host .annotation {
  color: darkgray;
}
atom-text-editor .string,
:host .string {
  color: green;
}
atom-text-editor .name.class,
:host .name.class,
atom-text-editor .name.function,
:host .name.function {
  font-weight: bold;
}
atom-text-editor .highlight.find-result .region,
:host .highlight.find-result .region {
  border: none !important;
  background-color: rgba(255, 255, 0, 0.5) !important;
}
atom-text-editor .highlight.current-result .region,
:host .highlight.current-result .region {
  border: none !important;
}
